import React from "react";
import "./header.css";
import {Link} from 'react-router-dom'

const Header = () => {
  return (
    <header>
      <h1>
        <a href="/">
          Session<span>Tracker</span>
        </a>
      </h1>

      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/clients">Clients</Link>
          </li>
          <li>
            <Link to="/current">Current</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
